import React from "react";
import './ExpenseItem.css';


const ExpenseItem = () => {
  return (
    <div>
      <div>March 28th 2021</div>
      <div>
        <h2>Car Insurance</h2>
        <div>$200</div>
      </div>
    </div>
  );
};

export default ExpenseItem;
